import React, { createContext } from 'react';
const FirstN = createContext();
const LastN = createContext();


const App = () => {
  return (
    <>
    <select>
      <option value> 1 </option>
      <option> 2 </option>
      <option> 3 </option>
      <option> 4 </option>
      <option> 5 </option>
    </select>
    </>
  )
}
export default App;
